import './App.css';
import React from "react";
import { NavBar, Main } from "./components";

function App() {

  return (
    <div>
      <NavBar />
    <ContextProvider>
      <div className="container" style={{padding: "20px"}}>
      <Main />
      </div>
    </ContextProvider>   
    </div>   
  );
}

export default App;
